40 ),\n        re: /ellipse\\s*\\((\\s*\\d+\\s*,){3}\\s*\\d+\\s*\\)\\s*,/,\n        msg: $._(\"Make sure you end your statement with a *semi-colon*, not a comma\")\n    },\n    \n    {\n        //first argument missing e.g. ellipse(   , 70, 60, 240);\n        re: /ellipse\\s*\\(\\s*,\\s*(\\s*\\d+\\s*,*){3}\\)/,\n        msg: $._(\"You're missing the first number of the ellipse() command.\")\n    }, \n    \n    {\n        //first arg contains non numeric value \n        //e.g.  ellipse(pink , 70, 60, 240);\n        //      ellipse(_____, 70, 60, 240);\n        //      ellipse(-----, 70, 60, 240);\n        //Note: if value is an undefined var then  \"blah is not defined\" error message will\n        //      take priority over this message unless an additional syntax error is found\n        re: /ellipse\\s*\\(\\s*[^,\\)\\s]*[^0-9,\\)\\s]+[^,\\)\\s]*\\s*,[^\\)]+\\)/,\n        msg: $._(\"The first argument of the ellipse() command should be a number.\")\n    },\n\n    {\n        //using ) instead of ( e.g. ellipse)70,60,200);\n        //Note: \"It looks like you have an extra )\" error message will take priority over this\n        //message unless an additional syntax error is found\n        re: /ellipse\\s*\\)(\\s*\\d+\\s*,*){3}/,\n        msg: $._(\"The first parenthesis after the command name should be an opening parenthesis, not a closing parenthesis.\")\n    },\n    \n    {\n        //last two arguments missing e.g. ellipse(140, 170, , );\n        re: /ellipse\\s*\\((\\s*\\d+\\s*,*){2}\\s*,\\s*\\)/,\n        msg: $._(\"You're missing the last two numbers for the ellipse command, the width and height.\")\n    },\n    \n    {\n        // extra ) before 1st argument e.g. ellipse ()70,60,240);\n        //Note: \"It looks like you have an extra )\" error message will take priority over this\n        //message unless an additional syntax error is found\n        re: /ellipse\\s*\\(\\s*\\)(\\s*\\d+\\s*,*){4}\\)/,\n        msg: $._(\"There's an extra parenthesis before the first argument of the ellipse() command.\")\n    }, \n\n    {\n        // ; after command name e.g. ellipse;(140, 170, 260, 484);\n        re: /ellipse\\s*;\\s*\\((\\s*\\d+\\s*,*){4}\\)/,\n        msg: $._(\"You have an unnecessary semi-colon after the command name.\")\n    },\n\n    {\n        // extra , after last argument e.g. ellipse(140, 170,120, 140, )\n        //Note: \"It looks like you're trying to use ellipse(). In case you forgot ...\" error message\n        //will take priority over this message unless an additional syntax error is found\n        re: /ellipse\\s*\\((\\s*\\d+\\s*,\\s*){4}\\)/,\n        msg: $._(\"You have an extra comma after your last argument.\")\n    }\n    \n];\n\n/************\n* STEP 0\n*************/\nstaticTest($._(\"The bottom\"), function() {\n    var result = null;\n    var descrip = $._(\"In this challenge, you'll draw a snowman using the `ellipse()` command.\\n\\n\" +\n                \"Start off by making a circle, for the bottom of the snowman, with an `ellipse()` command. This should be the first `ellipse()` command in your program.\\n\\n\" +\n                \"We've suggested some good values for the `ellipse()` command in the hint code, but you can change those numbers around, as long as the bottom of your snowman is a circle near the bottom of the canvas and it's not too small!\");\n\nvar displayP = function() {\n// bottom circle:\nellipse(200, 300, 150, 150);\n    };\n    \n    /*****************\n    *Passing code \n    *****************/\n    \n    //has at least one ellipse\n    var matchOneEllipse1P  = function() {\n        ellipse($x1,$y1,$w1,$h1);\n    };\n    \n    //has at least two ellipses\n    var matchTwoEllipses1P = function() {\n        ellipse($x1,$y1,$w1,$h1);\n        ellipse($x2,$y2,$w2,$h2);\n    };\n    \n    //has at least three ellipses\n    var matchThreeEllipses1P = function() {\n        ellipse($x1,$y1,$w1,$h1);\n        ellipse($x2,$y2,$w2,$h2);\n        ellipse($x3,$y3,$w3,$h3);\n    };\n    \n    //has at least four ellipses\n    var matchFourEllipses1P = function() {\n        ellipse($x1,$y1,$w1,$h1);\n        ellipse($x2,$y2,$w2,$h2);\n        ellipse($x3,$y3,$w3,$h3);\n        ellipse($x4,$y4,$w4,$h4);\n    };\n    \n    /** check number of ellipses **/\n    //check that there is only one ellipse\n    var onlyOneEllipseMatch = anyPass(match(matchOneEllipse1P));\n    if(matches(matchTwoEllipses1P) ){ onlyOneEllipseMatch = fail(); }\n    \n    //check that there is only two ellipses\n    var onlyTwoEllipsesMatch = anyPass(match(matchTwoEllipses1P));\n    if(matches(matchThreeEllipses1P) ){ onlyTwoEllipsesMatch = fail(); }\n    \n    //check that there is only three ellipses\n    var onlyThreeEllipsesMatch = anyPass(match(matchThreeEllipses1P));\n    if(matches(matchFourEllipses1P) ){ onlyThreeEllipsesMatch = fail(); }\n    \n    /** check 1st ellipse is on the screen **/\n    \n    //check that all of the ellipse is on the screen\n    var bottomOnScreenC = constraint([\"$x1\",\"$y1\",\"$w1\",\"$h1\"],function(x1,y1,w1,h1) {\n        return  x1.type === \"Literal\" && y1.type === \"Literal\" && \n                w1.type === \"Literal\" && h1.type === \"Literal\" &&\n                (x1.value - w1.value/2) >= 0 && (x1.value + w1.value/2) <= 400 &&\n                (y1.value - h1.value/2) >= 0 && (y1.value + h1.value/2) <= 400; \n    });\n    \n    var matchFirstEllipseOnScreen1S = structure(matchOneEllipse1P,bottomOnScreenC);\n    var matchFirstEllipseOnScreen2S = structure(matchTwoEllipses1P,bottomOnScreenC);\n    var matchFirstEllipseOnScreen3S = structure(matchThreeEllipses1P,bottomOnScreenC);\n    \n    var oneEllipseFirstEllipseOnScreen = allPass(onlyOneEllipseMatch, match(matchFirstEllipseOnScreen1S) );\n    var twoEllipsesFirstEllipseOnScreen = allPass(onlyTwoEllipsesMatch, match(matchFirstEllipseOnScreen2S) );\n    var threeEllipsesFirstEllipseOnScreen = allPass(onlyThreeEllipsesMatch, match(matchFirstEllipseOnScreen3S) );\n\n    var firstEllipse EllipseMatch, match(matchFirstEllipseNearBottom1S) );\n    var twoEllipsesFirstEllipseNearBottom = allPass(onlyTwoEllipsesMatch, match(matchFirstEllipseNearBottom2S) );\n    var threeEllipsesFirstEllipseNearBottom = allPass(onlyThreeEllipsesMatch, match(matchFirstEllipseNearBottom3S));\n\n    var firstEllipseNearBottom = anyPass(oneEllipseFirstEllipseNearBottom,twoEllipsesFirstEllipseNearBottom,threeEllipsesFirstEllipseNearBottom);\n \n    \n                                       \n    result = allPass(firstEllipseOnScreen,firstEllipseCircular,firstEllipseNearBottom);\n                                    \n\n    /**************\n    *Failing Code\n    ***************/\n    \n    //check for at least one ellipse\n    var hasEllipseMatch = anyPass( match(matchOneEllipse1P) );\n    \n    /** ellipse not circular **/\n    \n    if ( !passes(result) && !passes(firstEllipseCircular) && passes(hasEllipseMatch) ) {\n        result = fail($._(\"Hm, your first ellipse, for the bottom of your snowman, should be a circle, so its width and height should be the same. Try making the third and fourth numbers in your first `ellipse()` the same number.\"));\n    }\n\n    /** bottom circle too far up **/\n    \n    if ( !passes(result) && !passes(firstEllipseNearBottom) && passes(hasEllipseMatch) ) {\n        result = fail($._(\"Hm, the first ellipse, for the bottom of your snowman, seems to be too far up. It's the bottom of your snowman, so it should be near the bottom of the canvas. Try making the second number in your first `ellipse()` larger.\"));\n    }\n    \n    \n    /** bottom edge of ellipse is below the screen **/\n    \n    //check that bottom edge of ellipse is below the screen\n    var bottomEdgeBelowScreenC = constraint([\"$y1\",\"$h1\"],function(y1,h1) {\n        return  y1.type === \"Literal\" && h1.type === \"Literal\" && (y1.value + h1.value/2) > 400; \n    });\n    \n    var matchBottomEdgeBelowScreen1S = structure(matchOneEllipse1P,bottomEdgeBelowScreenC);\n    var matchBottomEdgeBelowScreen2S = structure(matchTwoEllipses1P,bottomEdgeBelowScreenC);\n    var matchBottomEdgeBelowScreen3S = structure(matchThreeEllipses1P,bottomEdgeBelowScreenC);\n    \n    var oneEllipseBottomEdgeBelowScreen = allPass(onlyOneEllipseMatch, match(matchBottomEdgeBelowScreen1S) );\n    var twoEllipsesBottomEdgeBelowScreen = allPass(onlyTwoEllipsesMatch, match(matchBottomEdgeBelowScreen2S) );\n    var threeEllipsesBottomEdgeBelowScreen = allPass(onlyThreeEllipsesMatch, match(matchBottomEdgeBelowScreen3S));\n\n    var bottomEdgeBelowScreenMatch = anyPass(oneEllipseBottomEdgeBelowScreen,twoEllipsesBottomEdgeBelowScreen,threeEllipsesBottomEdgeBelowScreen);\n \n        \n    if (!passes(result) && !passes(firstEllipseOnScreen) && passes(bottomEdgeBelowScreenMatch) ) {\n        result = fail($._(\"Hm, the first ellipse, for the bottom of your snowman, seems to be too far down. It looks like the bottom of the ellipse is off the screen. Try making the second number in your first `ellipse()` smaller.\"));\n    }\n    \n    /** left edge of ellipse is left of the screen **/\n    \n    //check that left edge of ellipse is left of the screen\n    var leftEdgeLeftOfScreenC = constraint([\"$x1\",\"$w1\"],function(x1,w1) {\n        return  x1.type === \"Literal\" && w1.type === \"Literal\" && (x1.value - w1.value/2) < 0; \n    });\n    \n    var matchLeftEdgeLeftOfScreen1S = structure(matchOneEllipse1P,leftEdgeLeftOfScreenC);\n    var matchLeftEdgeLeftOfScreen2S = structure(matchTwoEllipses1P,leftEdgeLeftOfScreenC);\n    var matchLeftEdgeLeftOfScreen3S = structure(matchThreeEllipses1P,leftEdgeLeftOfScreenC);\n    \n    var oneEllipseLeftEdgeLeftOfScreen = allPass(onlyOneEllipseMatch, match(matchLeftEdgeLeftOfScreen1S) );\n    var twoEllipsesLeftEdgeLeftOfScreen = allPass(onlyTwoEllipsesMatch, match(matchLeftEdgeLeftOfScreen2S) );\n    var threeEllipsesLeftEdgeLeftOfScreen = allPass(onlyThreeEllipsesMatch, match(matchLeftEdgeLeftOfScreen3S));\n\n    var leftEdgeLeftOfScreenMatch = anyPass(oneEllipseLeftEdgeLeftOfScreen,twoEllipsesLeftEdgeLeftOfScreen,threeEllipsesLeftEdgeLeftOfScreen);\n \n    if (!passes(result) && !passes(firstEllipseOnScreen) && passes(leftEdgeLeftOfScreenMatch) ) {\n        result = fail($._(\"Hm, the first ellipse, for the bottom of your snowman, seems to be too far to the left. It looks like the left edge of the ellipse is off the screen. Try making the first number in your `ellipse()` larger.\"));\n    } \n \n    /** right edge of ellipse is off the screen **/\n \n    //check that right edge of ellipse is right of the screen\n    var rightEdgeRightOfScreenC = constraint([\"$x1\",\"$w1\"],function(x1,w1) {\n        return  x1.type === \"Literal\" && w1.type === \"Literal\" && (x1.value + w1.value/2) > 400; \n    });\n    \n    var matchRightEdgeRightOfScreen1S = structure(matchOneEllipse1P,rightEdgeRightOfScreenC);\n    var matchRightEdgeRightOfScreen2S = structure(matchTwoEllipses1P,rightEdgeRightOfScreenC);\n    var matchRightEdgeRightOfScreen3S = structure(matchThreeEllipses1P,rightEdgeRightOfScreenC);\n    \n    var oneEllipseRightEdgeRightOfScreen = allPass(onlyOneEllipseMatch, match(matchRightEdgeRightOfScreen1S) );\n    var twoEllipsesRightEdgeRightOfScreen = allPass(onlyTwoEllipsesMatch, match(matchRightEdgeRightOfScreen2S) );\n    var threeEllipsesRightEdgeRightOfScreen = allPass(onlyThreeEllipsesMatch, match(matchRightEdgeRightOfScreen3S));\n\n    var rightEdgeRightOfScreenMatch = anyPass(oneEllipseRightEdgeRightOfScreen,twoEllipsesRightEdgeRightOfScreen,threeEllipsesRightEdgeRightOfScreen);\n \n    var leftOrRightEdgeOffScreenMatch = anyPass(leftEdgeLeftOfScreenMatch,rightEdgeRightOfScreenMatch);\n \n        \n    if (!passes(result) && !passes(firstEllipseOnScreen) && passes(rightEdgeRightOfScreenMatch) ) {\n        result = fail($._(\"Hm, the first ellipse, for the bottom of your snowman, seems to be too far to the right. It looks like the right edge of the ellipse is off the screen. Try making the first number in your `ellipse()` smaller.\"));\n    }\n    \n    /** ellipse completely off screen **/\n    \n    //this should come after messages for ellipse partially off screen\n    \n    //check that ellipse is completely off the screen\n    var bottomCompletelyOffScreenC = constraint([\"$x1\",\"$y1\",\"$w1\",\"$h1\"],function(x1,y1,w1,h1) {\n        return  x1.type === \"Literal\" && y1.type === \"Literal\" && \n                w1.type === \"Literal\" && h1.type === \"Literal\" &&\n                (   (x1.value - w1.value/2) > 400 || (x1.value + w1.value/2) < 0 ||\n                    (y1.value - h1.value/2) > 400 || (y1.value + h1.value/2) < 0\n                ); \n    });\n    \n    var matchBottomCompletelyOffScreen1S = structure(matchOneEllipse1P,bottomCompletelyOffScreenC);\n    var matchBottomCompletelyOffScreen2S = structure(matchTwoEllipses1P,bottomCompletelyOffScreenC);\n    var matchBottomCompletelyOffScreen3S = structure(matchThreeEllipses1P,bottomCompletelyOffScreenC);\n    \n    var oneEllipseBottomCompletelyOffScreen = allPass(onlyOneEllipseMatch, match(matchBottomCompletelyOffScreen1S) );\n    var twoEllipsesBottomCompletelyOffScreen = allPass(onlyTwoEllipsesMatch, match(matchBottomCompletelyOffScreen2S) );\n    var threeEllipsesBottomCompletelyOffScreen = allPass(onlyThreeEllipsesMatch, match(matchBottomCompletelyOffScreen3S));\n\n    var bottomCompletelyOffScreenMatch = anyPass(oneEllipseBottomCompletelyOffScreen,twoEllipsesBottomCompletelyOffScreen,threeEllipsesBottomCompletelyOffScreen);\n    \n    if( !passes(result) && !passes(firstEllipseOnScreen) && passes(bottomCompletelyOffScreenMatch) ) {\n        result = fail($._(\"Hm, the first ellipse, for the bottom of your snowman, seems to be completely off the screen. The x value and y values (the first and second numbers) for the `ellipse()` should be between 0 and 400.\"));\n    }\n    \n    /** first ellipse completely hidden underneath third ellipse **/\n    \n    //check that 1s
